import React from 'react';
import Header from "./components/Header/Header";
import Item from "./components/Item/Item";
import Footer from "./components/Footer/Footer";


function App() {
  return (
      <div id="root">
        <div className="todo-container">
          <div className="todo-wrap">
           <Header />
            <Item/>
            <Footer/>
          </div>
        </div>
      </div>
  );
}

export default App;
